import React, { Component } from "react";

class Navbar extends Component {
  render() {
    return (
      <nav>
        <span>
          <i className="fa-solid fa-leaf"></i>
        </span>
        <span>Habit-Tracker</span>
      </nav>
    );
  }
}

export default Navbar;
